	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 611px; min-height: 397px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 601px; min-height: 387px;\"><p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">Hvordan vi bruker naturressursene vil ha konsekvenser for jordkloden og oss mennesker. For at vi skal kunne spise oss mette er vi helt avhengig av naturen, og det den gir oss. Matproduksjon står for en stor andel av de totale klimagassutslippene. </span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">​</span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">Konsekvensen av klimagassutslipp er:</span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">​</span></p>\n\n<ul>\n	<li style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif;\">Is smelter slik at vannstanden blir høyere og landområder forsvinner</span></li>\n	<li style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif;\">Arter kan utryddes</span></li>\n	<li style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif;\">Mer ekstremvær som kan ødelegge avlinger</span></li>\n</ul>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt;\">​</span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">Bærekraftig utvikling handler også om at vi globalt sett må fordele ressursene mer rettferdig.</span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">​</span></p>\n\n<p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">I Norge har vi et høyt forbruk, og skulle alle mennesker på jorda hatt det samme, ville vi ha trengt 3,6 jordkloder.</span></p></div></div>",
